import React from 'react';
import UsersList from '../components/UsersList';

const Users = () => {
	const USERS = [
		{
			id: 'u1',
			name: 'gopal',
			image:
				'https://instagram.fxds1-1.fna.fbcdn.net/v/t51.2885-15/e35/s1080x1080/119999847_3355861377972524_9080175088622862505_n.jpg?_nc_ht=instagram.fxds1-1.fna.fbcdn.net&_nc_cat=108&_nc_ohc=h-HuUFootEoAX9iS1tG&edm=AP_V10EBAAAA&ccb=7-4&oh=d5e83eb09da9ed247e7248ec706645c5&oe=6159DBA3&_nc_sid=4f375e',
			places: 0,
		},
	];

	return (
		<div>
			<UsersList items={USERS} />
		</div>
	);
};

export default Users;
